import { Button } from '@material-ui/core';
import './App.css';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import Box from '@material-ui/core/Box';
import me from '../src/me.svg';
import notion1 from '../src/notion1.svg';
import notion2 from '../src/notion2.svg';
import notion3 from '../src/notion3.svg';
import Processsteps from './Processsteps';
import Process from './Process';
function Processcomponent() {
  return (
    <Container maxWidth="xl" style={{ background: '#F2E7D6', position: "absolute"}}>
     <Grid container spacing = {2} alignContent="flex-start"  alignItems="center" justifyContent="center" style={{}}> 
        <Grid item xs={2}>
          <Process></Process>
        </Grid>
        <Grid item xs={3}>
         <h1>Hi</h1>
        </Grid>
        <Grid item xs={3}>
         <Processsteps></Processsteps>
        </Grid>

    </Grid>
    </Container>
  )
}

export default Processcomponent;
